import React from 'react';
import {BrowserRouter, Route, Switch } from 'react-router-dom';
import StreamCreate from './streams/StreamCreate';
import StreamDelete from './streams/StreamDelete';
import StreamEdit from './streams/StreamEdit';
import StreamList from './streams/StreamList';
import StreamShow from './streams/StreamShow';
import Header from './Header';
import history from '../history';


const App = () => {
    return (
        <div className="ui container">
            <BrowserRouter history = {history}>
                <div>
                <Header />
                <Switch>
                    <Route path="/" exact component={ScopeList} />
                    <Route path="/streams/new" exact component={ScopeCreate} />
                    <Route path="/streams/edit/:id" exact component={ScopeEdit} />
                    <Route path="/streams/delete/:id" exact component={ScopeDelete} />
                    <Route path="/streams/:id" exact component={ScopeShow} />
                    </Switch>
                </div>
            </BrowserRouter>
        </div>
    )}

export default App;
